def find_all_paths(matrix, n):

    def is_valid(x, y):
        return 0 <= x < n and 0 <= y < n and (matrix[x][y] == 1) and (not visited[x][y])

    def backtrack(x, y, path):
        if x == n - 1 and y == n - 1:
            paths.append(path)
            return
        visited[x][y] = True
        for (dx, dy, direction) in [(-1, 0, 'U'), (1, 0, 'D'), (0, -1, 'L'), (0, 1, 'R')]:
            (nx, ny) = (x + dx, y + dy)
            if is_valid(nx, ny):
                backtrack(nx, ny, path + direction)
        visited[x][y] = False
    if matrix[0][0] == 0 and matrix[n - 1][n - 1] == 0:
        return []
    visited = [[False] * n for _ in range(n)]
    paths = []
    backtrack(0, 0, '')
    return sorted(paths)

